import React from "react";
import {
  Card,
  CardContent,
  Typography,
  Grid,
  Divider,
  List,
  ListItem,
  ListItemText,
} from "@mui/material";

const TicketDetails = ({ ticket }) => {
  if (!ticket) return <Typography>No ticket data available.</Typography>;

  return (
    <Card sx={{ maxWidth: 800, margin: "20px auto", padding: 2 }}>
      <CardContent>
        <Typography variant="h5" gutterBottom>
          Ticket ID: {ticket.id}
        </Typography>
        <Typography variant="subtitle1" color="textSecondary">
          Status: {ticket.ticketStatus} | Created: {new Date(ticket.createdAt).toLocaleString()}
        </Typography>
        <Divider sx={{ marginY: 2 }} />

        {/* Assignee Information */}
        <Typography variant="h6">Assignee</Typography>
        <Typography>
          {ticket.assignee.firstName} {ticket.assignee.lastName} - {ticket.assignee.email}
        </Typography>
        <Typography variant="body2" color="textSecondary">
          {ticket.assignee.phoneNumber} | {ticket.assignee.address}
        </Typography>

        <Divider sx={{ marginY: 2 }} />

        {/* Customer Information */}
        <Typography variant="h6">Customer</Typography>
        <Typography>
          {ticket.customer.firstName} {ticket.customer.lastName} - {ticket.customer.email}
        </Typography>
        <Typography variant="body2" color="textSecondary">
          {ticket.customer.phoneNumber}
        </Typography>

        <Divider sx={{ marginY: 2 }} />

        {/* Vehicle Information */}
        <Typography variant="h6">Vehicle</Typography>
        <Typography>
          {ticket.vehicle.year} {ticket.vehicle.make} {ticket.vehicle.model} (VIN: {ticket.vehicle.vin})
        </Typography>
        <Typography variant="body2" color="textSecondary">
          Owner: {ticket.vehicle.owner.firstName} {ticket.vehicle.owner.lastName} - {ticket.vehicle.owner.email}
        </Typography>

        <Divider sx={{ marginY: 2 }} />

        {/* Services & Parts */}
        <Typography variant="h6">Services</Typography>
        <List>
          {ticket.serviceEntity.map((service, index) => (
            <ListItem key={index}>
              <ListItemText
                primary={`${service.serviceType}: ${service.serviceDetails}`}
                secondary={
                  service.partsRequired.length > 0 ? (
                    <ul>
                      {service.partsRequired.map((part, pIndex) => (
                        <li key={pIndex}>
                          {part.partName} - Qty: {part.partQty} - ${part.partPrice}
                        </li>
                      ))}
                    </ul>
                  ) : (
                    "No parts required."
                  )
                }
              />
            </ListItem>
          ))}
        </List>

        <Divider sx={{ marginY: 2 }} />

        {/* Cost Summary */}
        <Typography variant="h6">Cost Summary</Typography>
        <Typography>Preliminary Cost: ${ticket.preliminaryCost}</Typography>
        <Typography>Tax: ${ticket.tax}</Typography>
        <Typography>Subtotal: ${ticket.subtotal}</Typography>

      </CardContent>
    </Card>
  );
};

export default TicketDetails;
